real_t acado_solve_dim19_system( real_t* const A, real_t* const b, int* const rk_perm )
{
real_t det;

int i;
int j;
int k;

int indexMax;

int intSwap;

real_t valueMax;

real_t temp;

for (i = 0; i < 19; ++i)
{
rk_perm[i] = i;
}
det = 1.0000000000000000e+00;
for( i=0; i < (18); i++ ) {
	indexMax = i;
	valueMax = fabs(A[i*19+i]);
	for( j=(i+1); j < 19; j++ ) {
		temp = fabs(A[j*19+i]);
		if( temp > valueMax ) {
			indexMax = j;
			valueMax = temp;
		}
	}
	if( indexMax > i ) {
for (k = 0; k < 19; ++k)
{
	acadoWorkspace.rk_dim19_swap = A[i*19+k];
	A[i*19+k] = A[indexMax*19+k];
	A[indexMax*19+k] = acadoWorkspace.rk_dim19_swap;
}
	acadoWorkspace.rk_dim19_swap = b[i];
	b[i] = b[indexMax];
	b[indexMax] = acadoWorkspace.rk_dim19_swap;
	intSwap = rk_perm[i];
	rk_perm[i] = rk_perm[indexMax];
	rk_perm[indexMax] = intSwap;
	}
	det *= A[i*19+i];
	for( j=i+1; j < 19; j++ ) {
		A[j*19+i] = -A[j*19+i]/A[i*19+i];
		for( k=i+1; k < 19; k++ ) {
			A[j*19+k] += A[j*19+i] * A[i*19+k];
		}
		b[j] += A[j*19+i] * b[i];
	}
}
det *= A[360];
det = fabs(det);
acado_solve_dim19_triangular( A, b );
return det;
}

